"use client";

import Image from "next/image";
import { Container } from "@/components/Container";
import heroImg from "../../public/img/hero.png";
import Lottie from "lottie-react";
import animationData from "../lotties/hero.json";
import waitlistAnimation from "../lotties/waitlist_animation.json";
import cuteTextMessageAnimation from "../lotties/textbox-cute.json";
import { saveEmail } from "../_actions/postAction";
import { useState } from "react";

export const Hero = () => {
  const [email, setEmail] = useState("");
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState("");

  const handleGetStarted = async (event: React.MouseEvent<HTMLButtonElement>) => {

    console.log("handleGetStarted");
    event.preventDefault();
    setLoading(true);
    setMessage("");

    const formData = new FormData();
    formData.append("email", email);

    console.log("EMail", email);

    const result = await saveEmail(formData);

    if (result.error) {
      setMessage("Error: " + result.error);
    } else {
      setMessage("You're signed up! ðŸŽ‰");
      setEmail(""); // Clear input field
    }

    setLoading(false);
  };
  return (
    <>
      <Container className="flex flex-wrap pt-48">
        <div className="flex items-center w-full lg:w-1/2">
          <div className="max-w2xl mb-8">
            <h1 className="text-4xl font-bold leading-snug tracking-tight text-gray-800 lg:text-4xl lg:leading-tight xl:text-6xl xl:leading-tight dark:text-white">
              DeepLove AI Assistant <span className="text-pink-400">Gets you a girlfriend</span>
            </h1>
            <p className="py-5 text-xl leading-normal text-gray-500 lg:text-xl xl:text-2xl dark:text-gray-300">
              Struggling with dating conversations? DeepLove helps you say the right thing, flirt effortlessly, and turn chats into real connections.
              No more ghosting, awkward silences, or missed chancesâ€”just smooth conversations and better dates.
            </p>
            <div className="flex flex-col items-start space-y-3 sm:space-x-4 sm:space-y-0 sm:items-center sm:flex-row">
              <div className="flex flex-col items-start space-y-3 sm:space-x-4 sm:space-y-0 sm:items-center sm:flex-row">
                <input
                  type="email"
                  placeholder="Enter your email"
                  className="px-4 py-3 text-lg border rounded-md focus:outline-none focus:ring-2 focus:ring-pink-400"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                />

                <button
                  className="px-6 py-3 text-lg font-medium text-white bg-pink-500 rounded-md hover:bg-pink-600"
                  onClick={handleGetStarted}
                  disabled={loading}
                >
                  {loading ? "Submitting..." : "Get Started"}
                </button>
                {message && <p className="text-sm text-gray-600">{message}</p>}
                <Lottie
                  animationData={waitlistAnimation}
                  loop={true} // Set to false if you want it to play only once
                  className="w-96 md:w-1/5 object-cover hidden lg:block"
                />
              </div>
            </div>

          </div>
        </div>
        <div className="flex items-center justify-center w-full lg:w-1/2">
          <div className="">
            <Lottie
              animationData={animationData}
              loop={true} // Set to false if you want it to play only once
              // className="w-[616px] h-[617px] object-cover"
              className="w-96 md:w-4/5 object-cover"
            />

          </div>
          <Lottie
            animationData={cuteTextMessageAnimation}
            loop={true} // Set to false if you want it to play only once
            className="w-32 md:w-1/5 "
          />
        </div>
      </Container>
      <Container>
        <div className="flex flex-col justify-center">

          <div className="text-xl text-center text-gray-700 dark:text-white">
            Trusted by {" "}
            customers worldwide
          </div>

          <div className="inline-flex justify-center items-center gap-2 border-4 border-indigo-900 rounded-lg  p-1 px-2 w-fit">
            <p className="text-xl text-center text-black-700 dark:text-white">Powered by Deepseek</p>
            <DeepseekLogo />
          </div>
          <div className="flex flex-wrap justify-center gap-5 mt-10 md:justify-around">

            <div className="pt-2 text-gray-400 ">
              <HingeLogo />
            </div>
            <div className="pt-2 text-gray-400 ">
              <TinderLogo />
            </div>
            <div className="pt-2 text-gray-400 ">
              <BumbleLogo />
            </div>
            <div className="pt-2 text-gray-400 ">
              <BadooLogo />
            </div>
            <div className="pt-2 text-gray-400 ">
              <OkCupidLogo />
            </div>



          </div>



        </div>
      </Container>
    </>
  );
}

